import React, { Component } from 'react'

class Calc extends Component {
    constructor(){
        super()
        this.state={
            output:"Output will be displayed here"
        }
    }
    clear(){
        this.setState({
            output:"cleared"
        })
    }
    C(){
        this.setState({
            output:"0"
        })
    }
    render() {
    return (
        <div>
            <h1>{this.state.output}</h1>
            <button onClick={()=>this.clear()}>Clear</button>
            <button onClick={()=>this.c()}>C</button>
        </div>
    )
    }
}

export default Calc
